import React from 'react'
import './about_us.css';

const About_us = ({imgUrl, name, action}) => {
  return (
    <div className="about-us">
      <h1>About Us</h1>
      <p>
        We are a team of passionate individuals committed to providing the best
        experience for our customers. Our journey began in [year], and since then,
        we have been dedicated to offering top-quality products and services.
      </p>
      <p>
        Our mission is to empower our customers through our solutions, and we are
        constantly innovating to meet and exceed expectations.
      </p>
    </div>
  )
}

export default About_us;
